INSERT INTO `article` VALUES (1,1,'吴莫愁发胖了用药所致 吴莫愁为什么那么胖或因失恋','吴莫愁胖了是怎么回事呢？吴莫愁为什么那么胖？有传是吴莫愁用药所致，不过期经纪人否认，认为是拍摄角度的问题。近日，因“好声音”走红的吴莫愁以导师身份亮相某比赛，当天她身穿低胸装亮相，不过却不见以往的好身材，似乎发福明显，大腿变粗。据媒体报道，吴莫愁为了拍摄新专辑MV，经常工作到凌晨才收工，休息的时间不足，通过服用抗疲劳药物调理身体，而这些药物可能导致肥胖。还有网友称应该不胖，只是发型和衣服的问题。媒...','http://localhost/yii2/frontend/web/uploads/201508/03/20150803061004370.jpg','尚之潮','2015-08-03 10:10:04',1),(2,1,'【图】吴莫愁胖用药所致 经纪公司极力否认','伊秀新闻讯（news.yxlady.com）：对于明星来说，保持纤瘦的身材十分重要，因为纤瘦的身材可以让明星看起来更加美艳动人，而与之相反的发福的身材对明星来说似乎就是魔咒，要么瘦要么死在明星眼里就是真谛，此前张惠妹暴肥身材走样遭调侃成“弓长惠女未”，还有各种类似于“七月不减肥，八月张惠妹”的戏说。近日中国好声音学员吴莫愁也逃不过发福魔咒，据爆料,吴莫愁胖用药所致。工作虽然重要,但是身体也不能忽视...','http://localhost/yii2/frontend/web/uploads/201508/03/20150803061005479.png','news.yxlady.com','2015-08-03 10:10:07',1),(3,1,'吴莫愁胖用药所致 真是胃乳惹的祸？','某校园比赛的全国总决赛在北京举行，嘉宾导师吴莫愁亮相决赛前的新闻发布会近日，因“好声音”走红的吴莫愁以导师身份亮相某比赛，当天她身穿低胸装亮相，不过却不见以往的好身材，似乎发福明显，大腿变粗。据媒体报道，吴莫愁为了拍摄新专辑MV，经常工作到凌晨才收工，休息的时间不足，通过服用抗疲劳药物调理身体，而这些药物可能导致肥胖。媒体就此事采访了吴莫愁的经纪人，对方回应称是照片拍摄角度的问题，否认吴莫愁有服用...','http://localhost/yii2/frontend/web/uploads/201508/03/20150803061008539.jpg','网易','2015-08-03 10:10:08',1),(4,1,'吴莫愁胖用药所致是怎么回事？吴莫愁胖了发胖照片？吴(图)','简述：上周，有网友在微博上爆料称：“吴莫愁现在胖的啊!”还上传了吴莫愁参加某活动的现场演出照片。从照片中看，吴莫愁的确比之前胖了不少，因此有网友猜测，难道吴莫愁失恋了?所以暴饮暴食，以至于长胖了?对此，被怀疑因情绪不好而导致长胖的吴莫愁近日在微博上写道：“收工了!昨天凌晨上周，有网友在微博上爆料称：“吴莫愁现在胖的啊!”还上传了吴莫愁参加某活动的现场演出照片。从照片中看，吴莫愁的确比之前胖了不少，...','http://localhost/yii2/frontend/web/uploads/201508/03/20150803061010582.jpg','搜狐','2015-08-03 10:10:11',1),(5,1,'原标题;吴莫愁胖用药所致 不知道她能否减肥成功呢？','吴莫愁胖用药所致，揭秘吴莫愁和哈林私底下的那些事。近日，吴莫愁以导师身份亮相某比赛现场，她一身超低胸装扮现身，看上去大腿变粗，发福严重。吴莫愁为何变胖了？据了解，吴莫愁为了拍摄新专辑MV，经常工作到凌晨才收工，再加上经常参加活动，休息的时间很少，只能通过服用抗疲劳药物调理身体，而这些药物可能导致肥胖。吴莫愁胖用药所致吴莫愁与哈林传绯闻投稿邮箱：chuanbeiol@163.com 详情请访问川北在...','http://localhost/yii2/frontend/web/uploads/201508/03/20150803061013472.jpg','川北在线','2015-08-03 10:10:14',1),(6,1,'吴莫愁胖用药所致？揭娱乐圈发胖的明星们【组图】【2】','近日，因“好声音”走红的吴莫愁以导师身份亮相某比赛，当天她身穿低胸装亮相，不过却不见以往的好身材，似乎发福明显，大腿变粗。据媒体报道，吴莫愁为了拍摄新专辑MV，经常工作到凌晨才收工，休息的时间不足，通过服用抗疲劳药物调理身体，而这些药物可能导致肥胖。媒体就此事采访了吴莫愁的经纪人，对方回应称是照片拍摄角度的问题，否认吴莫愁有服用抗疲劳药物。经纪人表示：“照片是拍摄角度，她根本没那么胖！她感冒吃药都...','http://localhost/yii2/frontend/web/uploads/201508/03/20150803061015387.jpg','陕西传媒网','2015-08-03 10:10:16',1),(7,1,'吴莫愁变胖或用药所致 哪些药物会导致肥胖','近日，因“好声音”走红的吴莫愁以导师身份亮相某比赛，当天她身穿低胸装亮相，不过却不见以往的好身材，似乎发福明显，大腿变粗。据媒体报道，吴莫愁为了拍摄新专辑MV，经常工作到凌晨才收工，休息的时间不足，通过服用抗疲劳药物调理身体，而这些药物可能导致肥胖。媒体就此事采访了吴莫愁的经纪人，对方回应称是照片拍摄角度的问题，否认吴莫愁有服用抗疲劳药物。经纪人表示：“照片是拍摄角度，她根本没那么胖！她感冒吃药都...','http://localhost/yii2/frontend/web/uploads/201508/03/20150803062127658.jpg','99健康网','2015-08-03 10:21:28',1),(8,1,'吴莫愁胖用药所致 常服用抗疲劳药物','吴莫愁胖用药所致近日，吴莫愁变胖一事引来人们关注。据悉吴莫愁胖用药所致，因为工作繁忙，经常工作到凌晨，吴莫愁只能通过服用抗疲劳药物调理身体，而这些药物可能导致肥胖。吴莫愁胖用药所致，网友则有自己的看法，有网友表示再拼命工作也不如健康重要。还有网友称应该不胖，只是发型和衣服的问题。吴莫愁胖用药所致似乎提醒人们，为了自己身体健康，一定要注意休息与调理。天府早报报导，吴莫愁以导师身份亮相某比赛现场，她一...','http://localhost/yii2/frontend/web/uploads/201508/03/20150803062129173.jpg','大众网','2015-08-03 10:21:29',1),(9,1,'吴莫愁胖用药所致 膀大腰圆发福惨成张惠妹第二','对于明星来说，保持纤瘦的身材十分重要，此前张惠妹暴肥身材走样遭调侃成“弓长惠女未”，近日中国好声音学院吴莫愁也发福严重，据爆料，吴莫愁胖用药所致，因为工作繁忙经常服用抗疲劳药物，最后导致副作用。如今的吴莫愁膀大腰圆，跳劲歌热舞也难性感了。近日，吴莫愁变胖一事引来人们关注。据悉吴莫愁胖用药所致，因为工作繁忙，经常工作到凌晨，吴莫愁只能通过服用抗疲劳药物调理身体，而这些药物可能导致肥胖。吴莫愁胖用药所...','http://localhost/yii2/frontend/web/uploads/201508/03/20150803062130994.jpg','中国青年网','2015-08-03 10:21:30',1),(10,2,'吴莫愁发胖大腿粗壮用药所致 扒明星发胖前后惊悚对比照','吴莫愁发胖 大腿粗壮 图片来自网络明星生活在聚光灯下，比普通人更注意自己的身材容貌，他们 时刻都在与肥胖做着斗争，然而他们毕竟也是普通人，难免发胖，减肥成功后也难免复胖，不过虽说发胖是人之常情，但发胖后的容貌真是惨不忍睹啊，来看下吧。近日，吴莫愁以导师身份亮相某比赛现场，身穿蓝色裹胸短裙的吴莫愁，看上去大腿粗壮，有些发福。甚至有媒体称吴莫愁之所以发福是因为服用抗疲劳药物调理身体导致的，新浪娱乐就此...','http://localhost/yii2/frontend/web/uploads/201508/03/20150803062131124.jpg','中国网江苏频道','2015-08-03 10:21:31',1);
