INSERT INTO `article_content` VALUES (1,1,'<p><img src=\"http://localhost/yii2/frontend/web/uploads/201508/03/20150803061004370.jpg\" /></p><br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://i.shangc.net/allimg/150802/63-150P2113628.jpg\" /></p><br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://i.shangc.net/allimg/150802/63-150P2113627.jpg\" /></p><br>吴莫愁胖了是怎么回事呢？吴莫愁为什么那么胖？有传是吴莫愁用药所致，不过期经纪人否认，认为是拍摄角度的问题。<br>近日，因“好声音”走红的吴莫愁以导师身份亮相某比赛，当天她身穿低胸装亮相，不过却不见以往的好身材，似乎发福明显，大腿变粗。<br>据媒体报道，吴莫愁为了拍摄新专辑MV，经常工作到凌晨才收工，休息的时间不足，通过服用抗疲劳药物调理身体，而这些药物可能导致肥胖。<br>还有网友称应该不胖，只是发型和衣服的问题。<br>媒体就此事采访了吴莫愁的经纪人，对方回应称是照片拍摄角度的问题，否认吴莫愁有服用抗疲劳药物。<br>经纪人表示：“照片是拍摄角度，她根本没那么胖！她感冒吃药都很谨慎，抗疲劳药不可能。<br>至于微博说的胃乳，就是胃不适偶尔调节用的。<br>”她还透露，因为吴莫愁最近在筹备两张专辑，还以很多主题曲的合作，所以工作安排确实不轻松，但是都会尽量保证充足的休息。<br>吴莫愁的经纪人对“发福”一说坚决不承认，回应称：“我们瘦着呢！”<p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://i.shangc.net/allimg/150802/63-150P2113628-50.jpg\" /></p><br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://i.shangc.net/allimg/150802/63-150P2113629.jpg\" /></p><br><b>延伸阅读：因失恋导致暴肥？</b>上周，有网友在微博上爆料称：“吴莫愁现在胖的啊！”还上传了吴莫愁参加某活动的现场演出照片。<br>从照片中看，吴莫愁的确比之前胖了不少，因此有网友猜测，难道吴莫愁失恋了？所以暴饮暴食，以至于长胖了？对此，被怀疑因情绪不好而导致长胖的吴莫愁近日在微博上写道：“收工了！昨天凌晨3点到此时此刻！恕我累得想发疯，数不清多少小时了！重点是大家都很棒！都很用心！我也对抗了所有不适和痛苦！我尽力了！”疑似解释了发胖原因。<br>而记者为了进一步了解情况，致电了吴莫愁的宣传人员。<br>原来吴莫愁为了新专辑MV的拍摄，经常工作到凌晨才收工，再加上经常参加活动，吴莫愁休息的时间就很少，只能通过服用抗疲劳药物调理身体，在缓解疲劳的同时，吴莫愁也渐渐地胖了起来。<br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://i.shangc.net/allimg/150802/63-150P2113J2.jpg\" /></p><br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://i.shangc.net/allimg/150802/63-150P2113627-50.jpg\" /></p><br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://i.shangc.net/allimg/150802/63-150P2113626-50.jpg\" /></p><br>'),(2,2,'<p><img src=\"http://localhost/yii2/frontend/web/uploads/201508/03/20150803061005479.png\" /></p><br>伊秀新闻讯（news.yxlady.com）：对于明星来说，保持纤瘦的身材十分重要，因为纤瘦的身材可以让明星看起来更加美艳动人，而与之相反的发福的身材对明星来说似乎就是魔咒，要么瘦要么死在明星眼里就是真谛，此前张惠妹暴肥身材走样遭调侃成“弓长惠女未”，还有各种类似于“七月不减肥，八月张惠妹”的戏说。<br>近日中国好声音学员吴莫愁也逃不过发福魔咒，据爆料,吴莫愁胖用药所致。<br>工作虽然重要,但是身体也不能忽视。<br>最近网上一直在热议吴莫愁变胖事件,原本身材纤细的莫愁为什么会变胖呢?就让我们一起去看看究竟原因何在。<br>近日，以中国好声音出道的学员吴莫愁终于也以导师身份现身某比赛现场，只见她一袭蓝色裹胸短裙亮相，但是大腿和手臂看上去都很是粗壮，疑似身材走样。<br>之后就有媒体爆料称吴莫愁之所以发福是因为服用抗疲劳药物调理身体导致的，吴莫愁的经纪人立即做出回应称是照片拍摄角度的问题，她本人根本没有那么胖，还说吴莫愁对于药物的使用一向谨慎，绝对不会服用抗疲劳药物来提神。<br>由于吴莫愁最近的工作档期比较满，不仅在筹备两张专辑，还有很多主题曲的合作，工作确实很是繁忙，所以外界猜测她的发福是因为服用了抗疲劳的药物所致，但是经纪人回应说即使再忙，也会让吴莫愁保持充足的休息，而不会依赖药物来提神，因为这会伤害到艺人的身体。<br>'),(3,3,'<p><img src=\"http://localhost/yii2/frontend/web/uploads/201508/03/20150803061008539.jpg\" /></p><br>某校园比赛的全国总决赛在北京举行，嘉宾导师吴莫愁亮相决赛前的新闻发布会近日，因“好声音”走红的吴莫愁以导师身份亮相某比赛，当天她身穿低胸装亮相，不过却不见以往的好身材，似乎发福明显，大腿变粗。<br>据媒体报道，吴莫愁为了拍摄新专辑MV，经常工作到凌晨才收工，休息的时间不足，通过服用抗疲劳药物调理身体，而这些药物可能导致肥胖。<br>媒体就此事采访了吴莫愁的经纪人，对方回应称是照片拍摄角度的问题，否认吴莫愁有服用抗疲劳药物。<br>经纪人表示：“照片是拍摄角度，她根本没那么胖！她感冒吃药都很谨慎，抗疲劳药不可能。<br>至于微博说的胃乳（胃乳是胃药的一种，一般人（通常是台湾省人）常说的胃药，通常是指在药房购买的制酸剂，含有铝盐、钙盐、镁盐、或是铝镁混合制剂，也是俗称的胃片、胃乳，可以产生酸碱中和的作用，减缓胃部的不适与疼痛。<br>），就是胃不适偶尔调节用的。<br>”她还透露，因为吴莫愁最近在筹备两张专辑，还以很多主题曲的合作，所以工作安排确实不轻松，但是都会尽量保证充足的休息。<br>吴莫愁的经纪人对“发福”一说坚决不承认，回应称：“我们瘦着呢！”<b>延伸阅读：因失恋导致暴肥？</b>重庆商报讯上周，有网友在微博上爆料称：“吴莫愁现在胖的啊！”还上传了吴莫愁参加某活动的现场演出照片。<br>从照片中看，吴莫愁的确比之前胖了不少，因此有网友猜测，难道吴莫愁失恋了？所以暴饮暴食，以至于长胖了？对此，被怀疑因情绪不好而导致长胖的吴莫愁近日在微博上写道：“收工了！昨天凌晨3点到此时此刻！恕我累得想发疯，数不清多少小时了！重点是大家都很棒！都很用心！我也对抗了所有不适和痛苦！我尽力了！”疑似解释了发胖原因。<br>而记者为了进一步了解情况，致电了吴莫愁的宣传人员。<br>原来吴莫愁为了新专辑MV的拍摄，经常工作到凌晨才收工，再加上经常参加活动，吴莫愁休息的时间就很少，只能通过服用抗疲劳药物调理身体，在缓解疲劳的同时，吴莫愁也渐渐地胖了起来。<br>原标题:吴莫愁胖用药所致？经纪人否认：拍摄角度问题 瘦着呢'),(4,4,'简述：上周，有网友在微博上爆料称：“吴莫愁现在胖的啊!”还上传了吴莫愁参加某活动的现场演出照片。<br>从照片中看，吴莫愁的确比之前胖了不少，因此有网友猜测，难道吴莫愁失恋了?所以暴饮暴食，以至于长胖了?对此，被怀疑因情绪不好而导致长胖的吴莫愁近日在微博上写道：“收工了!昨天凌晨<p><img src=\"http://localhost/yii2/frontend/web/uploads/201508/03/20150803061010582.jpg\" /></p><br>上周，有网友在微博上爆料称：“吴莫愁现在胖的啊!”还上传了吴莫愁参加某活动的现场演出照片。<br>从照片中看，吴莫愁的确比之前胖了不少，因此有网友猜测，难道吴莫愁失恋了?所以暴饮暴食，以至于长胖了?对此，被怀疑因情绪不好而导致长胖的吴莫愁近日在微博上写道：“收工了!昨天凌晨3点到此时此刻!恕我累得想发疯，数不清多少小时了!重点是大家都很棒!都很用心!我也对抗了所有不适和痛苦!我尽力了!”疑似解释了发胖原因。<br>而记者为了进一步了解情况，致电了吴莫愁的宣传人员。<br>原来吴莫愁为了新专辑MV的拍摄，经常工作到凌晨才收工，再加上经常参加活动，吴莫愁休息的时间就很少，只能通过服用抗疲劳药物调理身体，在缓解疲劳的同时，吴莫愁也渐渐地胖了起来。<br>'),(5,5,'吴莫愁胖用药所致，揭秘吴莫愁和哈林私底下的那些事。<br>近日，吴莫愁以导师身份亮相某比赛现场，她一身超低胸装扮现身，看上去大腿变粗，发福严重。<br>吴莫愁为何变胖了？据了解，吴莫愁为了拍摄新专辑MV，经常工作到凌晨才收工，再加上经常参加活动，休息的时间很少，只能通过服用抗疲劳药物调理身体，而这些药物可能导致肥胖。<br><p><img src=\"http://localhost/yii2/frontend/web/uploads/201508/03/20150803061013472.jpg\" /></p><br>吴莫愁胖用药所致<p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://finance.gucheng.com/UploadFiles_7830/201508/2015080111574854.jpg\" /></p><br>吴莫愁与哈林传绯闻投稿邮箱：chuanbeiol@163.com 详情请访问川北在线：http://www.guangyuanol.cn'),(6,6,'<p><img src=\"http://localhost/yii2/frontend/web/uploads/201508/03/20150803061015387.jpg\" /></p><br>近日，因“好声音”走红的吴莫愁以导师身份亮相某比赛，当天她身穿低胸装亮相，不过却不见以往的好身材，似乎发福明显，大腿变粗。<br>据媒体报道，吴莫愁为了拍摄新专辑MV，经常工作到凌晨才收工，休息的时间不足，通过服用抗疲劳药物调理身体，而这些药物可能导致肥胖。<br>媒体就此事采访了吴莫愁的经纪人，对方回应称是照片拍摄角度的问题，否认吴莫愁有服用抗疲劳药物。<br>经纪人表示：“照片是拍摄角度，她根本没那么胖！她感冒吃药都很谨慎，抗疲劳药不可能。<br>至于微博说的胃乳，就是胃不适偶尔调节用的。<br>”她还透露，因为吴莫愁最近在筹备两张专辑，还以很多主题曲的合作，所以工作安排确实不轻松，但是都会尽量保证充足的休息。<br>吴莫愁的经纪人对“发福”一说坚决不承认，回应称：“我们瘦着呢！”<b>延伸阅读：因失恋导致暴肥？</b>重庆商报讯上周，有网友在微博上爆料称：“吴莫愁现在胖的啊！”还上传了吴莫愁参加某活动的现场演出照片。<br>从照片中看，吴莫愁的确比之前胖了不少，因此有网友猜测，难道吴莫愁失恋了？所以暴饮暴食，以至于长胖了？对此，被怀疑因情绪不好而导致长胖的吴莫愁近日在微博上写道：“收工了！昨天凌晨3点到此时此刻！恕我累得想发疯，数不清多少小时了！重点是大家都很棒！都很用心！我也对抗了所有不适和痛苦！我尽力了！”疑似解释了发胖原因。<br>而记者为了进一步了解情况，致电了吴莫愁的宣传人员。<br>原来吴莫愁为了新专辑MV的拍摄，经常工作到凌晨才收工，再加上经常参加活动，吴莫愁休息的时间就很少，只能通过服用抗疲劳药物调理身体，在缓解疲劳的同时，吴莫愁也渐渐地胖了起来。<br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://www.sxdaily.com.cn/NMediaFile/2015/0802/SXRB201508020857000333159254073.jpg\" /></p><br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://www.sxdaily.com.cn/NMediaFile/2015/0802/SXRB201508020857000328809458406.jpg\" /></p><br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://www.sxdaily.com.cn/NMediaFile/2015/0802/SXRB201508020857000323610447445.jpg\" /></p><br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://www.sxdaily.com.cn/NMediaFile/2015/0802/SXRB201508020857000325578542740.jpg\" /></p><br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://www.sxdaily.com.cn/NMediaFile/2015/0802/SXRB201508020857000323314144129.jpg\" /></p><br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://www.sxdaily.com.cn/NMediaFile/2015/0802/SXRB201508020857000336190482713.jpg\" /></p><br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://www.sxdaily.com.cn/NMediaFile/2015/0802/SXRB201508020857000330185147805.jpg\" /></p><br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://www.sxdaily.com.cn/NMediaFile/2015/0802/SXRB201508020857000338943726440.jpg\" /></p><br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://www.sxdaily.com.cn/NMediaFile/2015/0802/SXRB201508020857000330384084738.jpg\" /></p><br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://www.sxdaily.com.cn/NMediaFile/2015/0802/SXRB201508020857000323494932458.jpg\" /></p><br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://www.sxdaily.com.cn/NMediaFile/2015/0802/SXRB201508020857000331239792195.jpeg\" /></p><br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://www.sxdaily.com.cn/NMediaFile/2015/0802/SXRB201508020857000336079436348.jpeg\" /></p><br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://www.sxdaily.com.cn/NMediaFile/2015/0802/SXRB201508020857000330912608381.jpeg\" /></p><br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://www.sxdaily.com.cn/NMediaFile/2015/0802/SXRB201508020857000346523674772.jpg\" /></p><br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://www.sxdaily.com.cn/NMediaFile/2015/0802/SXRB201508020857000342370432242.jpg\" /></p><br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://www.sxdaily.com.cn/NMediaFile/2015/0802/SXRB201508020857000346684037766.jpg\" /></p><br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://www.sxdaily.com.cn/NMediaFile/2015/0802/SXRB201508020857000340583420377.jpg\" /></p><br>'),(7,7,'<p><img src=\"http://localhost/yii2/frontend/web/uploads/201508/03/20150803062127658.jpg\" /></p><br>近日，因“好声音”走红的吴莫愁以导师身份亮相某比赛，当天她身穿低胸装亮相，不过却不见以往的好身材，似乎发福明显，大腿变粗。<br>据媒体报道，吴莫愁为了拍摄新专辑MV，经常工作到凌晨才收工，休息的时间不足，通过服用抗疲劳药物调理身体，而这些药物可能导致肥胖。<br>媒体就此事采访了吴莫愁的经纪人，对方回应称是照片拍摄角度的问题，否认吴莫愁有服用抗疲劳药物。<br>经纪人表示：“照片是拍摄角度，她根本没那么胖！她感冒吃药都很谨慎，抗疲劳药不可能。<br>至于微博说的胃乳（胃乳是胃药的一种，一般人（通常是台湾省人）常说的胃药，通常是指在药房购买的制酸剂，含有铝盐、钙盐、镁盐、或是铝镁混合制剂，也是俗称的胃片、胃乳，可以产生酸碱中和的作用，减缓胃部的不适与疼痛。<br>），就是胃不适偶尔调节用的。<br>”她还透露，因为吴莫愁最近在筹备两张专辑，还以很多主题曲的合作，所以工作安排确实不轻松，但是都会尽量保证充足的休息。<br>吴莫愁的经纪人对“发福”一说坚决不承认，回应称：“我们瘦着呢！”<b> 延伸阅读：引起肥胖的药物有哪些</b>1.类固醇类药物：这种药是用来治疗自身免疫性疾病的，如红斑狼疮或哮喘，可以减缓新陈代谢，却也可以使身体多余的脂肪沉积，尤其是在腹部，莫顿医生说，这种情况是相当多见的，它们可以使你的体重从20磅增加到40磅。<br>2.抗抑郁药：抗抑郁药可以导致体重增加，并影响人的食欲。<br>莫顿医生说，情绪和心情与人的食欲和体重是紧密相连的，它们的关系非常密切。<br>按理说，如果你试图去调整其中的一样，其它的就会受到影响。<br>抗过敏的抗组胺药也有同样会影响食欲。<br>3.胰岛素：虽然胰岛素在许多情况下可以挽救生命，也是I型糖尿病患者治疗的常用药，但胰岛素会增加饥饿感并使糖尿病患者的体重增加，并且这又会导致他们需要更多的胰岛素。<br>4.β-受体阻滞剂和他汀类药物：这些是用来治疗高血压，青光眼，偏头痛的，β受体阻滞剂会降低你的能量水平，使其难以被消耗。<br>同样的，他汀类药物（胆固醇），可导致肌肉痉挛和运动受限。<br>5.抗生素：莫顿医生指出：“我们可以看到在养殖业，他们给动物使用抗生素，使它们体重增加。<br>这其中的原因就是这些药物使它们肠道菌群失调。<br>”他还补充道，“抗生素的效果可能是累加的。<br>在一项有前瞻性的研究中，随着时间的推移，有耳部感染儿童，他们都服用了大量的抗生素，是及易引起肥胖的。<br>这目前还没有确凿的证据，但这也足以让你认识到抗生素的滥用了。<br>”药物对身体的一些副作用是不可避免的。<br>我们在治疗疾病的同时，只能尽量选择对身体的负面影响比较小的治疗方法。<br>而随着现在医学的发展，相信以后的医疗手段会越来越发达，对身体伤害越来越小。<br>'),(8,8,'<p><img src=\"http://localhost/yii2/frontend/web/uploads/201508/03/20150803062129173.jpg\" /></p><br>吴莫愁胖用药所致近日，吴莫愁变胖一事引来人们关注。<br>据悉吴莫愁胖用药所致，因为工作繁忙，经常工作到凌晨，吴莫愁只能通过服用抗疲劳药物调理身体，而这些药物可能导致肥胖。<br>吴莫愁胖用药所致，网友则有自己的看法，有网友表示再拼命工作也不如健康重要。<br>还有网友称应该不胖，只是发型和衣服的问题。<br>吴莫愁胖用药所致似乎提醒人们，为了自己身体健康，一定要注意休息与调理。<br>天府早报报导，吴莫愁以导师身份亮相某比赛现场，她一身超低胸装扮现身，看上去大腿变粗，发福严重。<br>2013年，吴莫愁因参加选秀节目一战成名，纤细的身材和尖尖的下巴给观众留下了深刻的印象。<br>为何如今会发福？据了解，吴莫愁为了拍摄新专辑MV，经常工作到凌晨才收工，再加上经常参加活动，休息的时间很少，只能通过服用抗疲劳药物调理身体，而这些药物可能导致肥胖。<br>'),(9,9,'对于明星来说，保持纤瘦的身材十分重要，此前张惠妹暴肥身材走样遭调侃成“弓长惠女未”，近日中国好声音学院吴莫愁也发福严重，据爆料，吴莫愁胖用药所致，因为工作繁忙经常服用抗疲劳药物，最后导致副作用。<br>如今的吴莫愁膀大腰圆，跳劲歌热舞也难性感了。<br><p><img src=\"http://localhost/yii2/frontend/web/uploads/201508/03/20150803062130994.jpg\" /></p><br>近日，吴莫愁变胖一事引来人们关注。<br>据悉吴莫愁胖用药所致，因为工作繁忙，经常工作到凌晨，吴莫愁只能通过服用抗疲劳药物调理身体，而这些药物可能导致肥胖。<br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://upload.ct.youth.cn/2015/0803/1438571139225.jpg\" /></p><br>吴莫愁胖用药所致，网友则有自己的看法，有网友表示再拼命工作也不如健康重要。<br>还有网友称应该不胖，只是发型和衣服的问题。<br>吴莫愁胖用药所致似乎提醒人们，为了自己身体健康，一定要注意休息与调理。<br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://upload.ct.youth.cn/2015/0803/1438571139912.jpg\" /></p><br>天府早报报导，吴莫愁以导师身份亮相某比赛现场，她一身超低胸装扮现身，看上去大腿变粗，发福严重。<br>2013年，吴莫愁因参加选秀节目一战成名，纤细的身材和尖尖的下巴给观众留下了深刻的印象。<br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://upload.ct.youth.cn/2015/0803/1438571139197.jpg\" /></p><br>为何如今会发福？据了解，吴莫愁为了拍摄新专辑MV，经常工作到凌晨才收工，再加上经常参加活动，休息的时间很少，只能通过服用抗疲劳药物调理身体，而这些药物可能导致肥胖。<br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://upload.ct.youth.cn/2015/0803/1438571139295.jpg\" /></p><br>早前的张惠妹身材苗条，在舞台上能歌善舞，而如今的张惠妹不止身材臃肿不堪，就连原本小小的脸蛋，也出现了厚厚两层的双下巴。<br>歌迷表示““阿妹啊，你怎么能胖成这样?”'),(10,10,'<p><img src=\"http://localhost/yii2/frontend/web/uploads/201508/03/20150803062131124.jpg\" /></p><br>吴莫愁发胖 大腿粗壮 图片来自网络<p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://jiangsu.china.com.cn/uploadfile/2015/0802/1438476809074919.jpg\" /></p><br>明星生活在聚光灯下，比普通人更注意自己的身材容貌，他们 时刻都在与肥胖做着斗争，然而他们毕竟也是普通人，难免发胖，减肥成功后也难免复胖，不过虽说发胖是人之常情，但发胖后的容貌真是惨不忍睹啊，来看下吧。<br>近日，吴莫愁以导师身份亮相某比赛现场，身穿蓝色裹胸短裙的吴莫愁，看上去大腿粗壮，有些发福。<br>甚至有媒体称吴莫愁之所以发福是因为服用抗疲劳药物调理身体导致的，新浪娱乐就此事独家采访了吴莫愁的经纪人，对方回应称是照片拍摄角度的问题，否认吴莫愁有服用抗疲劳药物。<br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://jiangsu.china.com.cn/uploadfile/2015/0802/1438476808899692.jpg\" /></p><br>图片来自网络经纪人表示：“照片是拍摄角度，她根本没那么胖!她感冒吃药都很谨慎，抗疲劳药不可能。<br>至于微博说的胃乳，就是胃不适偶尔调节用的。<br>”她还透露，因为吴莫愁最近在筹备两张专辑，还以很多主题曲的合作，所以工作安排确实不轻松，但是都会尽量保证充足的休息。<br><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://jiangsu.china.com.cn/uploadfile/2015/0802/1438476810106175.jpg\" /></p><br>图片来自网络吴莫愁的经纪人对“发福”一说坚决不承认，回应称：“我们瘦着呢!”<b>扒明星发胖前后惊悚对比照。<br></b><p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://jiangsu.china.com.cn/uploadfile/2015/0802/1438476809814520.jpg\" /></p><br>明星发胖 图片来自网络<p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://jiangsu.china.com.cn/uploadfile/2015/0802/1438476809671749.jpg\" /></p><br>陈好发胖 图片来自网络<p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://jiangsu.china.com.cn/uploadfile/2015/0802/1438476809505561.jpg\" /></p><br>范冰冰发胖<p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://jiangsu.china.com.cn/uploadfile/2015/0802/1438476809383895.jpg\" /></p><br>张惠妹发胖<p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://jiangsu.china.com.cn/uploadfile/2015/0802/1438476809959308.jpg\" /></p><br>明星发胖 图片来自网络<p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://jiangsu.china.com.cn/uploadfile/2015/0802/1438476809265151.jpg\" /></p><br>明星发胖 图片来自网络<p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://jiangsu.china.com.cn/uploadfile/2015/0802/1438476896941209.jpg\" /></p><br>明星发胖 图片来自网络<p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://jiangsu.china.com.cn/uploadfile/2015/0802/1438476897085220.jpg\" /></p><br>大S发胖 图片来自网络<p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://jiangsu.china.com.cn/uploadfile/2015/0802/1438476897261518.jpg\" /></p><br>黄奕发胖 图片来自网络<p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://jiangsu.china.com.cn/uploadfile/2015/0802/1438476897431178.jpg\" /></p><br>明星发胖 图片来自网络<p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://jiangsu.china.com.cn/uploadfile/2015/0802/1438476897559800.jpg\" /></p><br>明星发胖 图片来自网络<p><img src=\"http://imgstore01.cdn.sogou.com/v2/thumb/dl/8692399.jpg?appid=10150005&url=http://jiangsu.china.com.cn/uploadfile/2015/0802/1438476897747150.jpg\" /></p><br>明星发胖 图片来自网络');
